<!DOCTYPE html PUBLIC "-//W3C//DTD XHTML 1.0 Transitional//EN" "http://www.w3.org/TR/xhtml1/DTD/xhtml1-transitional.dtd">
<html xmlns="http://www.w3.org/1999/xhtml">
<head>
<meta http-equiv="Content-Type" content="text/html; charset=utf-8" />
<meta name="viewport" content="width=device-width, initial-scale=1, maximum-scale=1, user-scalable=no">
<meta name="renderer" content="webkit">
<title>提示信息</title>
<meta http-equiv="Cache-Control" content="no-siteapp" />
<style type="text/css">
body,button,input,select,textarea,th{color:#000;background-color:#fff;font-size:14px;line-height:1.5;font-family:poppin,Tahoma,Arial,\5FAE\8F6F\96C5\9ED1,sans-serif;font-family:Tahoma,Arial,\5FAE\8F6F\96C5\9ED1,sans-serif/9;}body::-webkit-scrollbar{width:8px;}::-webkit-scrollbar{width:10px;height:10px;}body::-webkit-scrollbar-thumb{background-color:#ddd;}.mod_popup{position:absolute;border:1px solid #bfbfbf;box-shadow:0 0 10px rgba(0,0,0,.3);z-index:999;background-color:#fff;font-size:14px;color:#333;}.popup__hd{position:relative;line-height:55px;text-align:center;border-bottom:1px solid #f2f2f2;}.popup__tit{font-size:16px;font-weight:400;}.popup__close{position:absolute;top:6px;right:6px;width:24px;height:24px;overflow:hidden;z-index:2;}a{color:#000;text-decoration:none;}.popup__icon_close{display:block;margin:6px auto;width:12px;height:12px;background-position:0 -200px;}.popup__icon_close,.popup__icon_close.sprite,.popup__icon_tips,.popup__icon_tips.sprite,.popup_download__icon,.popup_download__icon.sprite,.popup_tips__icon,.popup_tips__icon.sprite{background-image:url(data:image/png;base64,);background-image:-webkit-image-set(url(data:image/png;base64,) 1x,url(data:image/png;base64,) 2x);}.icon_txt{font:0/0 a;}.popup__bd_inner{margin-top:30px;padding:0 108px 28px;position:relative;}.icon_popup_note{background-position:0 0;}.popup__icon_tips{position:absolute;top:0;left:40px;width:48px;height:48px;}.popup__subtit{font-size:14px;padding:13px 0 14px 0;font-weight:400;}.popup__desc{color:#999;}.popup__bd:after{clear:both;content:' ';display:block;}.popup__ft{padding:20px 20px 0 0;height:60px;text-align:right;}.popup__ft .mod_btn,.popup__ft .mod_btn_green{width:auto;min-width:122px;text-align:center;}.upload_btns__item{width:122px;margin:0 3px;}.mod_btn{border:1px solid #c9c9c9;color:#000;}.mod_btn,.mod_btn_green{border-radius:2px;font-size:14px;margin-right:6px;padding:0 23px;height:38px;line-height:38px;display:inline-block;white-space:nowrap;box-sizing:border-box;overflow:hidden;}.mod_btn_green{border:1px solid #31c27c;background-color:#31c27c;color:#fff;}.mod_popup_mask{position:fixed;top:0;left:0;width:100%;height:100%;filter:progid:DXImageTransform.Microsoft.gradient(enabled='true',startColorstr='#33000000',endColorstr='#33000000');background:rgba(0,0,0,.2);z-index:999;}
</style>
</head>
<body>
<div id="divdialog_0" class="mod_popup" data-aria="popup" style="position: fixed; z-index: 100000; top: 179px; margin: 10px; width: 450px; height: auto; left: 734px;">
  <div class="popup__hd">
    <h2 class="popup__tit">提示信息</h2>
    <a href="javascript:;" class="popup__close" title="关闭"><i class="popup__icon_close"></i><i class="icon_txt">关闭</i></a> </div>
  <div class="popup__bd " id="dialogbox">
    <div class="popup__bd_inner">
      <div class="popup__icon_tips icon_popup_note"></div>
      <h3 class="popup__subtit ">{{$message}}</h3>
      <p class="popup__desc"></p>
    </div>
  </div>
  <div class="popup__ft">
    <button style="display: none;" class="mod_btn upload_btns__item js-button1"></button>
    <button style="display:;" class="mod_btn_green upload_btns__item js-button2">确定</button>
  </div>
</div>
<div class="mod_popup_mask"></div>
<script src="https://cdn.bootcdn.net/ajax/libs/jquery/1.12.3/jquery.min.js"></script>
<script>
(function() {
    $('.popup__close').on("click", function() {
        $("body").css({
            overflowY: "scroll"
        }), $(".mod_popup_mask").hide(), $("#divdialog_0").off().remove();
    })
    $('.js-button2').on("click", function() {
        $('.popup__close').click();
    })
})();
</script>
</body>
</html>
